import React from 'react';
import './started.css';
import {Container, Row, Col} from 'react-bootstrap';
import Header from '../../common/sectionHeader/sectionHeader.js';

function started() {
    return (
        <section className = "about mb-5" id = "about">
            <Container>
                <Header effectType = "fade-up" headerText = "Getting Started" contentText = "Learn about how to use our service"></Header>
                <Row>
                    <Col lg = {2}>
                        
                    </Col>
                    <Col>
                    
                    </Col>
                </Row>
            </Container>
            
        </section>
    )
}

export default started
